import React from "react";
import SidebarMenu from 'react-bootstrap-sidebar-menu';
import '../Dashboard.css'
const Sidebar = props => {
    return (
<SidebarMenu>
<SidebarMenu.Header>{"Menu"}
    <SidebarMenu.Brand>{"Menu"}
    </SidebarMenu.Brand>
    <SidebarMenu.Toggle />
  </SidebarMenu.Header> {"Menu"}
  <SidebarMenu.Body> {"Menu"}
    <SidebarMenu.Nav> {"Menu"}
      <SidebarMenu.Nav.Link> {"Menu"}
        <SidebarMenu.Nav.Icon>
          {/* Menu item icon */}
        </SidebarMenu.Nav.Icon>
        <SidebarMenu.Nav.Title> {"Menu"}
          {/* Menu item title */}
        </SidebarMenu.Nav.Title>
      </SidebarMenu.Nav.Link>
    </SidebarMenu.Nav> {"Menu"}
    <SidebarMenu.Sub> {"Menu"}
      <SidebarMenu.Sub.Toggle>
        <SidebarMenu.Nav.Icon />
        <SidebarMenu.Nav.Title> {"Menu"}
          {/* Submenu title */}
        </SidebarMenu.Nav.Title>
      </SidebarMenu.Sub.Toggle>
      <SidebarMenu.Sub.Collapse>
        <SidebarMenu.Nav> {"Menu"}
          <SidebarMenu.Nav.Link> {"Menu"}
            <SidebarMenu.Nav.Icon>
              {/* Submenu item icon */}
            </SidebarMenu.Nav.Icon>
            <SidebarMenu.Nav.Title> {"Menu"}
              {/* Submenu item title */}
            </SidebarMenu.Nav.Title> {"Menu"}
          </SidebarMenu.Nav.Link> {"Menu"}
        </SidebarMenu.Nav>
      </SidebarMenu.Sub.Collapse>
    </SidebarMenu.Sub>
  </SidebarMenu.Body>
</SidebarMenu>

        );
  };
  export default Sidebar
